func addBinary(a string, b string) string {

	if len(a) > len(b) {
		a, b = b, a
	}

	ans := ""
	jin := false
	for i := len(a) - 1; i >= 0; i-- {
		count := a[i] - '0' + b[i] - '0'

		if jin {
			count += 1
		}

		if count >= 2 {
			jin = true
			count = count - 2
		} else {
			jin = false
		}
		fmt.Println("Count is ", count)
		//ans += strconv.Itoa(count)
		fmt.Println("Ans is ", ans)

	}

	for i := len(b) - 1; i >= len(a); i-- {
		count := b[i] - '0'
		if jin {
			count += 1
		}

		if count >= 2 {
			jin = true
			count = count - 2
		} else {
			jin = false
		}
		fmt.Println("Count is ", count)

		//ans += strconv.Itoa(count)
		fmt.Println("Ans is ", ans)

	}

	if jin {
		ans += "1"
	}

	return ans
}

func numSub(s string) int {

	res := make([]int, len(s))

	if s[0] == '1' {
		res[0] = 1
	} else {
		res[0] = 0
	}
	for i := 1; i < len(s); i++ {
		if s[i] == '0' {
			res[i] = 0
		} else {
			res[i] = res[i-1] + 1
		}
	}

	var count int64
	for i := 0; i < len(res); i++ {
		//count += res[i] % (10^9 + 7)

		count += int64(res[i])
		if count > math.MaxInt64 {
			fmt.Println("---------")
		}

		if count > 1000000007 {
			count -= 1000000007
		}
	}
	//if count > math.MaxInt32 {
	//	count = count % (10^9 + 7)
	//}
	return int(count)
}

