func maxProbability(n int, edg [][]int, sp []float64, start int, end int) float64 {

	// 输入：n = 3, edges = [[0,1],[1,2],[0,2]], succProb = [0.5,0.5,0.2], start = 0, end = 2
	//输出：0.25000
	// 解释：从起点到终点有两条路径，其中一条的成功概率为 0.2 ，而另一条为 0.5 * 0.5 = 0.25

	eMap := make(map[int][]int)
	sMap := make(map[string]float64)

	for i := 0; i < len(edg); i++ {
		ed := edg[i]
		b, e := ed[0], ed[1]
		if v, ok := eMap[b]; ok {
			v = append(v, e)
			eMap[b] = v
		} else {
			eMap[b] = []int{e}
		}

		sMap[strconv.Itoa(b)+"-"+strconv.Itoa(e)] = sp[i]
	}

	ok, score := check(eMap, sMap, start, end)
	if ok {
		return score
	}
	return float64(0)
}

func check(eMap map[int][]int, sMap map[string]float64, start int, end int) (bool, float64) {

	// map[0:[1 2] 1:[2]]
	// map[0-1:0.5 0-2:0.2 1-2:0.5]

	if v, ok := eMap[start]; ok {

		// sMap[strconv.Itoa(b) + "-" + strconv.Itoa(e)] = sp[i]
		max := float64(-1)
		for i := 0; i < len(v); i++ {
			b, e := start, v[i]

			score := sMap[strconv.Itoa(b)+"-"+strconv.Itoa(e)]
			if e != end {
				ok, checkSocre := check(eMap, sMap, e, end)
				if !ok {
					continue
				}
				score = checkSocre * score
			}
			max = maxNum(max, score)
		}
		if max == -1 {
			return false, 0
		}
		return true, max
	} else {
		return false, float64(0)
	}
}

func maxNum(a, b float64) float64 {
	if a > b {
		return a
	}
	return b
}

